import type { KeyValue } from '../is';
/**
 * 调起o2o框架
 *
 * @deprecated
 * @param url 调起的页面url
 * @param opt 调起的参数
 * @param schemeHead 协议头
 *
 * @example
 * ```js
 * // 例如：调起o2o打开百度首页
 * o2o('http://m.baidu.com', {color:'0000ff'});
 * // 调起o2o框架，打开首页，并且指定顶框黑条颜色改变成0000ff(16进制颜色值)
 * o2o('http://m.baidu.com', {color:'0000ff'});
 * // 调起直达号
 * o2o('http://m.baidu.com', {appid:xxxx})
 * ```
 */
export declare function o2o(url: string | KeyValue, opt?: KeyValue, schemeHead?: string): void;
